// Certifications.js

import React from 'react';
import '../styles/projects.css'; // Add your CSS file for styling
import Navbar from './Navbar';
import FinancialReport from '../assets/financialreport.png';

const Project_Page = () => {
  return (
    <div className="certifications-container">
      <Navbar/>
      <div>
        <p className="Myworktext">My Work</p>
      </div>
      <div>
        <div className="sectiontitle">
          <p>Intrective Dashbord</p>

          <div className="projecContainer">
            <div className="projectsection">
              <div className="indevidualProject">
                <div className="indevidualProjectImage">
                   <img src={FinancialReport}/>
                </div>
                <p>Finacial Report</p>

              </div>
            </div>
          </div>
        </div>
      </div>
    </div>
  );
};

export default Project_Page;
